column8:
LEDライトバーを装備した86・BRZ用のテールランプに、シーケンシャルウィンカー（連鎖点灯式）を装備。進行方向に向かって流れるように点灯します。<br><br>●左右セット ●リフレクター内蔵 ●キャンセラー内蔵 ●カプラーオンで取付可能<br><br>【LEDの球切れ、水漏れ（レンズ接合部からの水滴の浸入）に対してご購入されてから1年間完全保証いたします。※保証が適用されるのは製品本体に保証番号の付いたSONAR正規品のみとなりますのでご了承下さい。】<br><br><br>対応車種：12/3～ ZN6 86 / C6 BRZ　HID車<br><br>ランプ、レンズ | テールランプ<br>トヨタ | 86 | ZN6 <br>※メーカー在庫切れの場合は納期を別途ご案内いたします。<tr><td colspan="2">
<center><img src="https://image.rakuten.co.jp/parts/cabinet/design/2017summertire2.jpg" border="0" width="800px"><br>
</td></tr></center>


